 We can use React Context to share the state between components.

Here is an example of how you can achieve this:

First, create a context file `tooltipContext.js`:
```js
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const closeTooltip = () => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ tooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```
In this file, we create a context using `createContext` and a provider component `TooltipProvider` that wraps the children components and provides the `tooltip` and `closeTooltip` functions to them.

Next, create a `Tooltip` component that uses the context:
```js
import { useContext } from 'react';
import { TooltipContext } from './tooltipContext';

const Tooltip = ({ children, text }) => {
  const { tooltip, closeTooltip } = useContext(TooltipContext);

  const handleClick = () => {
    if (tooltip) {
      closeTooltip();
    } else {
      setTooltip(text);
    }
  };

  return (
    <div onClick={handleClick}>
      {children}
      {tooltip && (
        <div className="tooltip">
          <span>{tooltip}</span>
          <button onClick={closeTooltip}>Close</button>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
In this component, we use the `useContext` hook to get the `tooltip` and `closeTooltip` functions from the context. We also define a `handleClick` function that checks if there is a currently open tooltip and closes it if so, or sets the new tooltip if not.

Finally, use the `TooltipProvider` component to wrap your app and provide the context to all components:
```js
import React from 'react';
import { render } from 'react-dom';
import { TooltipProvider } from './tooltipContext';
import App from './App';

const rootElement = document.getElementById('root');
render(
  <TooltipProvider>
    <App />
  </TooltipProvider>,
  rootElement
);
```
Now, you can use the `Tooltip` component in your app and it will close the previously opened tooltip when you open a new one.

You can also use the `closeTooltip` function in other components to close the tooltip programmatically.

